--
-- Create view "Municipios"
--
CREATE VIEW "Municipios" (
  "PaisId",
  "PaisNombre",
  "PaisIso1",
  "PaisIso2",
  "DepartamentoId",
  "DepartamentoNombre",
  "DepartamentoCodigo",
  "MunicipioId",
  "MunicipioNombre",
  "MunicipioCodigo",
  "MunicipioActivo"
) AS
    SELECT D."PaisId",
           P."Nombre" AS "PaisNombre",
           P."Iso1" AS "PaisIso1",
           P."Iso2" AS "PaisIso2",
           M."DepartamentoId",
           D."Nombre" AS "DepartamentoNombre",
           D."Codigo" AS "DepartamentoCodigo",
           M."Id" AS "MunicipioId",
           M."Nombre" AS "MunicipioNombre",
           M."Codigo" AS "MunicipioCodigo",
           M."Activo" AS "MunicipioActivo"
      FROM "Departamento" D
        LEFT OUTER JOIN "Pais" P
          ON D."PaisId" = P."Id"
        RIGHT OUTER JOIN "Municipio" M
          ON M."DepartamentoId" = D."Id";

