  "Id",
  "Titulo",
  "Descripcion",
  "CreadoEl",
  "EditadoEl",
  "Activo",
  "CreadoPor",
  "EditadoPor",
  "Orden",
  "Preguntas"
) AS
    SELECT e."Id",
           e."Titulo",
           e."Descripcion",
           e."CreadoEl",
           e."EditadoEl",
           e."Activo",
           e."CreadoPor",
           e."EditadoPor",
