-- Create view "Cursos"
--
CREATE VIEW "Cursos" (
  "Id",
  "DependenciaId",
  "DependenciaNombre",
  "TipoCursoId",
  "TipoCursoNombre",
  "EscuelaId",
  "EscuelaNombre",
  "NivelId",
  "NivelNombre",
