  "ProductoNombre",
  "MunicipioId",
  "MunicipioNombre",
  "DepartamentoId",
  "DepartamentoNombre",
  "TerritorialId",
  "TerritorialNombre",
  "PaisId",
  "PaisNombre",
  "PaisIso1",
  "PaisIso2",
  "ProgramaId",
  "ProgramaNombre",
  "ProgramaFechaInicio",
  "NucleoId",
  "NucleoFechaInicio",
  "NucleoNombre",
  "BancoId",
  "BancoNombre",
  "BancoFechaInicio",
  "EstadoCursoId",
  "EstadoCursoNombre",
  "CertificadoEtiquetaId",
  "CertificadoEtiquetaNombre",
  "CupoTotal",
  "CupoAula",
  "Nombre",
  "Descripcion",
  "CodigoVerificacion",
  "Responsable",
  "CorreoElectronico",
  "TelefonoContacto",
  "HorasTotales",
  "NumeroDias",
  "PorcentajeValidoAsistencia",
  "CantidadAulas",
  "LugarRealizacion",
  "FechaInicioInscripcion",
  "FechaFinInscripcion",
  "FechaInicio",
  "FechaFin",
  "HoraInicio",
  "Publicado",
  "JornadaManana",
  "JornadaTarde",
  "JornadaNoche",
  "Objetivos",
  "Contenidos",
  "ImagenCertificado",
  "ImagenCurso",
  "CertificadoCiudad",
  "CertificadoVerCiudad",
  "CertificadoFechaExpedicion",
  "CreadoEl",
  "EditadoEl",
  "Activo",
  "CreadoPor",
  "EditadoPor",
  "Orden"
) AS
    SELECT C."Id",
           C."DependenciaId",
           DP."Nombre" AS "DependenciaNombre",
           C."TipoCursoId",
           TC."Nombre" AS "TipoCursoNombre",
           NV."EscuelaId",
           ES."Nombre" AS "EscuelaNombre",
           C."NivelId",
           NV."Nombre" AS "NivelNombre",
           C."TipoAsistenciaId",
           TA."Nombre" AS "TipoAsistenciaNombre",
           C."ElaboradoPorId",
           EP."Nombre" AS "ElaboradoPorNombre",
           C."IndicadorId",
           "IN"."Nombre" AS "IndicadorNombre",
           "IN"."ProductoId",
           PR."Nombre" AS "ProductoNombre",
           C."MunicipioId",
           MN."Nombre" AS "MunicipioNombre",
           MN."DepartamentoId",
           DPT."Nombre" AS "DepartamentoNombre",
           DPT."TerritorialId",
           TER."Nombre" AS "TerritorialNombre",
           DPT."PaisId",
           PA."Nombre" AS "PaisNombre",
           PA."Iso1" AS "PaisIso1",
           PA."Iso2" AS "PaisIso2",
           C."ProgramaId",
           PG."Nombre" AS "ProgramaNombre",
           PG."FechaInicio" AS "ProgramaFechaInicio",
           PG."NucleoId",
           NU."FechaInicio" AS "NucleoFechaInicio",
           NU."Nombre" AS "NucleoNombre",
           NU."BancoId",
           BP."Nombre" AS "BancoNombre",
           BP."FechaInicio" AS "BancoFechaInicio",
           C."EstadoCursoId",
           EC."Nombre" AS "EstadoCursoNombre",
           C."CertificadoEtiquetaId",
           CE."Nombre" AS "CertificadoEtiquetaNombre",
           C."CupoTotal",
           C."CupoAula",
           C."Nombre",
           C."Descripcion",
           C."CodigoVerificacion",
           C."Responsable",
           C."CorreoElectronico",
           C."TelefonoContacto",
           C."HorasTotales",
           C."NumeroDias",
           C."PorcentajeValidoAsistencia",
           C."CantidadAulas",
           C."LugarRealizacion",
           C."FechaInicioInscripcion",
           C."FechaFinInscripcion",
           C."FechaInicio",
           C."FechaFin",
           C."HoraInicio",
           C."Publicado",
           C."JornadaManana",
           C."JornadaTarde",
           C."JornadaNoche",
           C."Objetivos",
           C."Contenidos",
           C."ImagenCertificado",
           C."ImagenCurso",
           C."CertificadoCiudad",
           C."CertificadoVerCiudad",
           C."CertificadoFechaExpedicion",
           C."CreadoEl",
           C."EditadoEl",
           C."Activo",
           C."CreadoPor",
           C."EditadoPor",
           C."Orden"
      FROM "Curso" C
        LEFT OUTER JOIN "Clasificador" DP
          ON C."DependenciaId" = DP."Id"
        LEFT OUTER JOIN "Clasificador" TC
          ON C."TipoCursoId" = TC."Id"
        LEFT OUTER JOIN "Nivel" NV
          ON C."NivelId" = NV."Id"
        LEFT OUTER JOIN "Escuela" ES
          ON NV."EscuelaId" = ES."Id"
        LEFT OUTER JOIN "Clasificador" TA
          ON C."TipoAsistenciaId" = TA."Id"
        LEFT OUTER JOIN "Clasificador" EP
          ON C."ElaboradoPorId" = EP."Id"
        LEFT OUTER JOIN "Indicador" "IN"
          ON C."IndicadorId" = "IN"."Id"
        LEFT OUTER JOIN "Producto" PR
          ON "IN"."ProductoId" = PR."Id"
        LEFT OUTER JOIN "Municipio" MN
          ON C."MunicipioId" = MN."Id"
        LEFT OUTER JOIN "Departamento" DPT
          ON MN."DepartamentoId" = DPT."Id"
        LEFT OUTER JOIN "Clasificador" TER
          ON DPT."TerritorialId" = TER."Id"
        LEFT OUTER JOIN "Pais" PA
          ON DPT."PaisId" = PA."Id"
        LEFT OUTER JOIN "Programa" PG
          ON C."ProgramaId" = PG."Id"
        LEFT OUTER JOIN "Nucleo" NU
          ON PG."NucleoId" = NU."Id"
        LEFT OUTER JOIN "BancoPrograma" BP
          ON NU."BancoId" = BP."Id"
        LEFT OUTER JOIN "Clasificador" EC
          ON C."EstadoCursoId" = EC."Id"
        LEFT OUTER JOIN "Clasificador" CE
          ON C."CertificadoEtiquetaId" = CE."Id";

--
-- Create view "Clasificadores"
--
CREATE VIEW "Clasificadores" (
  "PadreTipoId",
  "PadreTipoNombre",
  "PadreId",
  "PadreNombre",
  "TipoId",
  "TipoNombre",
  "Id",
  "Nombre",
  "Descripcion",
  "Orden",
  "Hijos",
  "Activo",
  "CreadoEl",
  "CreadoPor",
  "EditadoEl",
  "EditadoPor"
) AS
    SELECT P."TipoId" AS "PadreTipoId",
           PT."Nombre" AS "PadreTipoNombre",
           C."PadreId",
           P."Nombre" AS "PadreNombre",
           C."TipoId",
           T."Nombre" AS "TipoNombre",
           C."Id",
           C."Nombre",
           C."Descripcion",
           C."Orden",
           (SELECT COUNT(*)
               FROM "Clasificador"
               WHERE "PadreId" = C."Id") AS "Hijos",
           C."Activo",
           C."CreadoEl",
           C."CreadoPor",
           C."EditadoEl",
           C."EditadoPor"
      FROM "Clasificador" C
        LEFT OUTER JOIN "ClasificadorTipo" T
          ON C."TipoId" = T."Id"
        LEFT OUTER JOIN "Clasificador" P
          ON C."PadreId" = P."Id"
        LEFT OUTER JOIN "ClasificadorTipo" PT
          ON PT."Id" = P."TipoId";

