--
-- Create view "NucleosProgramas"
--
CREATE VIEW "NucleosProgramas" (
  "Id",
  "BancoId",
  "NucleoId",
  "BancoProgramaNombre",
  "NucleoNombre"
) AS
    SELECT BPN."Id",
           BPN."BancoId",
           BPN."NucleoId",
           BP."Nombre" AS "BancoProgramaNombre",
           N."Nombre" AS "NucleoNombre"
      FROM "BancoPrograma" BP
        RIGHT OUTER JOIN "BancoProgramaNucleo" BPN
          ON BP."Id" = BPN."BancoId"
        LEFT OUTER JOIN "Nucleo" N
          ON N."Id" = BPN."NucleoId";

--
-- Create view "BancoProgramasNucleos"
--
CREATE VIEW "BancoProgramasNucleos" (
  "Id",
  "BancoId",
  "NucleoId",
  "BancoProgramaNombre",
  "NucleoNombre"
) AS
    SELECT BN."Id",
           BN."BancoId",
           BN."NucleoId",
           B."Nombre" AS "BancoProgramaNombre",
           N."Nombre" AS "NucleoNombre"
      FROM "BancoPrograma" B
        RIGHT OUTER JOIN "BancoProgramaNucleo" BN
          ON B."Id" = BN."BancoId"
        LEFT OUTER JOIN "Nucleo" N
          ON N."Id" = BN."NucleoId";

